const Item = ({ item }) => {
  const removeItemHandler = (id) => {
    console.log(id);
  };

  return (
    <li>
      <input type="checkbox" />
      <span style={item.packed ? { textDecoration: "line-through" } : {}}>
        {item.description}
      </span>
      <button onClick={removeItemHandler}>&times;</button>
    </li>
  );
};

export default Item;
